      body: '\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Miscellaneous\n  Variables\n\n\n\n    Index\n    \n        \n            \n                \n                    \n                        \n                            dataSourceFactory(src/.../db.config.ts)\n                        \n                        \n                            DEFAULT_CURRENCY(src/.../money.type.ts)\n                        \n                        \n                            getDatabaseConfig(src/.../db.config.ts)\n                        \n                        \n                            validCurrenciesConst(src/.../valid.currencies.const.ts)\n                        \n                    \n                \n            \n        \n    \n\n\n    src/config/db/db.config.ts\n    \n        \n        \n            \n                \n                    \n                    \n                        dataSourceFactory\n                        \n                    \n                \n            \n                \n                    \n                        Default value : async (options) => {\n  if (!options) {\n    throw new Error("DataSourceOption not provided");\n  }\n  const dataSource = new DataSource(options);\n  await dataSource.initialize();\n  return dataSource;\n}\n                    \n                \n\n\n        \n    \n    \n        \n            \n                \n                    \n                    \n                        getDatabaseConfig\n                        \n                    \n                \n            \n                \n                    \n                        Default value : async (\n  configService: ConfigService\n): Promise => ({\n  type: "postgres",\n  host: configService.get("DATASOURCE_HOST"),\n  port: configService.get("DATASOURCE_PORT"),\n  username: configService.get("DATASOURCE_USERNAME"),\n  password: configService.get("DATASOURCE_PASSWORD"),\n  database: configService.get("DATASOURCE_DATABASE"),\n  entities: [],\n  synchronize: true,\n})\n                    \n                \n\n\n        \n    \n\n    src/common/types/money/money.type.ts\n    \n        \n        \n            \n                \n                    \n                    \n                        DEFAULT_CURRENCY\n                        \n                    \n                \n            \n                \n                    \n                        Type :         string\n\n                    \n                \n                \n                    \n                        Default value : "USD"\n                    \n                \n\n\n        \n    \n\n    src/common/types/money/valid.currencies.const.ts\n    \n        \n        \n            \n                \n                    \n                    \n                        validCurrenciesConst\n                        \n                    \n                \n            \n                \n                    \n                        Type :     []\n\n                    \n                \n                \n                    \n                        Default value : [\n  "USD",\n  "EUR",\n  "GBP",\n  "AED" /* ... and other supported currencies */,\n]\n                    \n                \n\n\n        \n    \n\n\n\n\n                   \n    \n         results matching ""\n        \n    \n    \n        No results matching ""\n    \n\n',
